public class Project170 {
	public static void main(String[] args) {
		int[][] matrix = new int[50][50];
		for (int i = 0; i < 50; i += 1) {
			for (int h = 0; h < 50; h += 1) {
				if (i == h) {
					matrix[i][h] = 0;
				}
				if (i < 25 && h >= 25) {
					matrix[i][h] = 100;
				} else if (i >= 25 && h < 25) {
					matrix[i][h] = 100;
				} else {
					matrix[i][h] = 0;
				}
			}
		}

		for (int i = 0; i < 50; i += 1) {
			for (int h = 0; h < 50; h += 1) {
				System.out.printf("%d ", matrix[i][h]);
			}
			System.out.println("");
		}
	}
}
